                    <p>Given positive integers a and b, there exist unique integers q and r satisfying a = bq +
                        r, 0 &lt;= r &lt;= b</p>
                       <h6> Note:Â Dividend (a) = divisor (b) x quotient (q) + remainder (r)</h6>
                       
            </div>
    )
}

export default LoadContent;
